mapper.select:

select 

from TB_PAY_PROVISIONAL_ATTACHMENT_USER
where DOCUMENT_NO = #{DOCUMENT_NO,jdbcType=VARCHAR}
  and PAYMENT_USER_ID = #{PAYMENT_USER_ID,jdbcType=VARCHAR}

mapper.delete:

delete from TB_PAY_PROVISIONAL_ATTACHMENT_USER
where DOCUMENT_NO = #{DOCUMENT_NO,jdbcType=VARCHAR}
  and PAYMENT_USER_ID = #{PAYMENT_USER_ID,jdbcType=VARCHAR}
